import React, {Component} from "react";
import {ProductConsumer} from "../Context";
import {Link} from "react-router-dom";

class Details extends Component{
    render() {
        return(
          <ProductConsumer>
              {value => {
                  const {productName, productCode, productPrice, img, inCar, details} = value.productDetails;
                  console.log(value.productDetails.productName);
                  return(
                      <div className="container py-5">
                          {/*title*/}
                          <div className="row">
                            <div className="col-10 mx-auto text-center my-5">
                                <h1>{productName}</h1>
                            </div>
                          </div>
                          {/*end title*/}
                          {/*product details*/}
                          <div className="row">
                              <div className="col-10 mx-auto col-md-6 my-3">
                                  <img src={img} className="img-fluid" alt="img"></img>
                              </div>
                              <div className="col-10 mx-auto col-md-6 my-3">
                                 <h5> Price: {productPrice} </h5>
                                  <h6 className="text-uppercase text-muted mt-3 mb-4"> Code: {productCode} </h6>
                                  <h5> Details: {details} </h5>
                              </div>
                          </div>
                      </div>
                  );
              }}
          </ProductConsumer>
        );
    }
}

export default Details;
